import React from 'react';
import {MenuItems} from './MenuItems';
import './NavBar.css';


const Navbbar = () => {
    return (
      <nav className="NavBarItems">
        <h2 className="navbar-logo">TodoList </h2>
        <ul>
          {MenuItems.map((item,index)=>{
            return (
              <li key={index}>
                <a className={item.cName} href={item.url}>
                  {item.title}
                </a>
              </li>
            )
          })}
        </ul>
      </nav>
    )
}

export default Navbbar
